import React, { useEffect } from "react";
import web from "../src/images/landing.png";
import Common from "./Common";
import Aos from "aos";
import "aos/dist/aos.css";

const Home = () => {
  useEffect(() => {
    Aos.init({ duration: 2000 });
  }, []);

  return (
    <>
      <div data-aos="fade-right">
        <Common
          name="Grow your business with"
          imgsrc={web}
          visit="/service"
          btname="Get Started"
        />
      </div>
    </>
  );
};

export default Home;
